    "<b>{{code}}</b> is expired, and has been removed.": "\u0421\u0440\u043e\u043a \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0435\u0433\u043e \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u0430 \u0438\u0441\u0442\u0435\u043a, \u0438 \u043e\u043d \u0431\u044b\u043b \u0443\u0434\u0430\u043b\u0435\u043d: <b>{{code}}</b>.",
    "<b>{{code}}</b> is invalid, and has been removed.": "\u041d\u0435\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u044d\u043b\u0435\u043c\u0435\u043d\u0442 <b>{{code}}</b> \u0431\u044b\u043b \u0443\u0434\u0430\u043b\u0435\u043d.",
    "<b>{{code}}</b> is sold out, and has been removed.": "\u042d\u043b\u0435\u043c\u0435\u043d\u0442 <b>{{code}}</b> \u0431\u044b\u043b \u0440\u0430\u0441\u043f\u0440\u043e\u0434\u0430\u043d \u0438 \u0443\u0434\u0430\u043b\u0435\u043d.",
    "<b>{{couponCode}}</b> has expired": "\u0421\u0440\u043e\u043a \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u043a\u0443\u043f\u043e\u043d\u0430 <b>{{couponCode}}</b> \u0438\u0441\u0442\u0435\u043a",
