    "<b>{{couponCode}}</b> is not applied": "\u041d\u0435\u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u043a\u0443\u043f\u043e\u043d <b>{{couponCode}}</b>",
