    "Each individual topic chosen should comprehensively describe your course's content without being too broad. E.g.\n                        \"The Complete Tennis Course\" should have \"Tennis\" \u2013 not \"Tennis Serve\" (specific, but not comprehensive) and not \"Sports\"\n                        (comprehensive, but not specific).": "\u041a\u0430\u0436\u0434\u0430\u044f \u043e\u0442\u0434\u0435\u043b\u044c\u043d\u0430\u044f \u0432\u044b\u0431\u0440\u0430\u043d\u043d\u0430\u044f \u0442\u0435\u043c\u0430 \u0434\u043e\u043b\u0436\u043d\u0430 \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u043e \u0438 \u0442\u043e\u0447\u043d\u043e \u043e\u043f\u0438\u0441\u044b\u0432\u0430\u0442\u044c \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u044b \u0432\u0430\u0448\u0435\u0433\u043e \u043a\u0443\u0440\u0441\u0430, \u043d\u0435 \u043e\u0431\u043e\u0431\u0449\u0430\u044f \u0438\u0445. \u041d\u0430\u043f\u0440\u0438\u043c\u0435\u0440\n                        \u0434\u043b\u044f \u043a\u0443\u0440\u0441\u0430 \"\u041f\u043e\u043b\u043d\u044b\u0439 \u043a\u0443\u0440\u0441 \u043f\u043e \u0442\u0435\u043d\u043d\u0438\u0441\u0443\" \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e \u0432\u044b\u0431\u0440\u0430\u0442\u044c \u0442\u0435\u043c\u0443 \"\u0422\u0435\u043d\u043d\u0438\u0441\", \u0430 \u043d\u0435 \"\u041f\u043e\u0434\u0430\u0447\u0430 \u0432 \u0442\u0435\u043d\u043d\u0438\u0441\u0435\" (\u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u0430\u044f, \u043d\u043e \u043d\u0435 \u0442\u043e\u0447\u043d\u0430\u044f) \u0438\u043b\u0438 \"\u0421\u043f\u043e\u0440\u0442\"\n                        (\u0442\u043e\u0447\u043d\u0430\u044f, \u043d\u043e \u043d\u0435 \u043a\u043e\u043d\u043a\u0440\u0435\u0442\u043d\u0430\u044f).",
