    "e.g. Landscape Photography": "\u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \u043f\u0435\u0439\u0437\u0430\u0436\u043d\u0430\u044f \u0444\u043e\u0442\u043e\u0433\u0440\u0430\u0444\u0438\u044f",
    "e.g. Python": "\u043d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, Python",
