    "or review <a href=\"%(href)s\" class=\"ext\" target=\"_blank\">Lecture %(index)s: %(lecture)s</a>": "\u043b\u0438\u0431\u043e \u043f\u0440\u043e\u0432\u0435\u0440\u044c\u0442\u0435 <a href=\"%(href)s\" class=\"ext\" target=\"_blank\">\u043b\u0435\u043a\u0446\u0438\u044e %(index)s: %(lecture)s</a>",
